import React from "react";

class LoginForm extends React.Component {
  render() {
    return (
      <div>
        <h1>Login</h1>
        <form>
          <input
            value={this.state.username}
            type="username"
            required
            placeholder="Enter user name"
            onChange={this.handleChange}
          />
          <input
            type="pasword"
            required
            placeholder="Enter pasword"
            onChange={this.handleChange}
          />
          <input type="submit" />
        </form>
      </div>
    );
  }
}

export default LoginForm;
